document.write("\u003c\u0021\u0044\u004f\u0043\u0054\u0059\u0050\u0045\u0020\u0068\u0074\u006d\u006c\u003e\u000a\u003c\u0068\u0074\u006d\u006c\u0020\u006c\u0061\u006e\u0067\u003d\u0022\u0065\u006e\u0022\u003e\u003c\u0068\u0065\u0061\u0064\u003e\u003c\u006d\u0065\u0074\u0061\u0020\u0068\u0074\u0074\u0070\u002d\u0065\u0071\u0075\u0069\u0076\u003d\u0022\u0043\u006f\u006e\u0074\u0065\u006e\u0074\u002d\u0054\u0079\u0070\u0065\u0022\u0020\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u003d\u0022\u0074\u0065\u0078\u0074\u002f\u0068\u0074\u006d\u006c\u003b\u0020\u0063\u0068\u0061\u0072\u0073\u0065\u0074\u003d\u0055\u0054\u0046\u002d\u0038\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u000a\u0020\u0020\u0020\u0020\u003c\u006d\u0065\u0074\u0061\u0020\u006e\u0061\u006d\u0065\u003d\u0022\u0076\u0069\u0065\u0077\u0070\u006f\u0072\u0074\u0022\u0020\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u003d\u0022\u0077\u0069\u0064\u0074\u0068\u003d\u0064\u0065\u0076\u0069\u0063\u0065\u002d\u0077\u0069\u0064\u0074\u0068\u002c\u0020\u0069\u006e\u0069\u0074\u0069\u0061\u006c\u002d\u0073\u0063\u0061\u006c\u0065\u003d\u0031\u002e\u0030\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u006c\u0069\u006e\u006b\u0020\u0072\u0065\u006c\u003d\u0022\u0073\u0074\u0079\u006c\u0065\u0073\u0068\u0065\u0065\u0074\u0022\u0020\u0068\u0072\u0065\u0066\u003d\u0022\u002e\u002f\u005a\u006f\u006f\u006d\u002d\u0043\u0061\u006c\u006c\u002d\u0047\u0072\u006f\u0075\u0070\u002d\u004d\u0065\u0065\u0074\u0069\u006e\u0067\u005f\u0066\u0069\u006c\u0065\u0073\u002f\u006e\u0061\u0076\u002e\u0063\u0073\u0073\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u006c\u0069\u006e\u006b\u0020\u0072\u0065\u006c\u003d\u0022\u0073\u0074\u0079\u006c\u0065\u0073\u0068\u0065\u0065\u0074\u0022\u0020\u0068\u0072\u0065\u0066\u003d\u0022\u002e\u002f\u005a\u006f\u006f\u006d\u002d\u0043\u0061\u006c\u006c\u002d\u0047\u0072\u006f\u0075\u0070\u002d\u004d\u0065\u0065\u0074\u0069\u006e\u0067\u005f\u0066\u0069\u006c\u0065\u0073\u002f\u006c\u0069\u006e\u006b\u002e\u0063\u0073\u0073\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u006c\u0069\u006e\u006b\u0020\u0072\u0065\u006c\u003d\u0022\u0073\u0074\u0079\u006c\u0065\u0073\u0068\u0065\u0065\u0074\u0022\u0020\u0068\u0072\u0065\u0066\u003d\u0022\u002e\u002f\u005a\u006f\u006f\u006d\u002d\u0043\u0061\u006c\u006c\u002d\u0047\u0072\u006f\u0075\u0070\u002d\u004d\u0065\u0065\u0074\u0069\u006e\u0067\u005f\u0066\u0069\u006c\u0065\u0073\u002f\u006d\u0065\u0065\u0074\u0069\u006e\u0067\u002e\u0063\u0073\u0073\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u006c\u0069\u006e\u006b\u0020\u0072\u0065\u006c\u003d\u0022\u0073\u0068\u006f\u0072\u0074\u0063\u0075\u0074\u0020\u0069\u0063\u006f\u006e\u0022\u0020\u0068\u0072\u0065\u0066\u003d\u0022\u0066\u0061\u0076\u0069\u0063\u006f\u006e\u0032\u002e\u0069\u0063\u006f\u0022\u0020\u0074\u0079\u0070\u0065\u003d\u0022\u0069\u006d\u0061\u0067\u0065\u002f\u0078\u002d\u0069\u0063\u006f\u006e\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u0073\u0063\u0072\u0069\u0070\u0074\u0020\u0073\u0072\u0063\u003d\u0022\u002e\u002f\u005a\u006f\u006f\u006d\u002d\u0043\u0061\u006c\u006c\u002d\u0047\u0072\u006f\u0075\u0070\u002d\u004d\u0065\u0065\u0074\u0069\u006e\u0067\u005f\u0066\u0069\u006c\u0065\u0073\u002f\u006a\u0071\u0075\u0065\u0072\u0079\u002e\u0033\u002e\u0037\u002e\u0030\u002e\u006a\u0073\u0022\u003e\u003c\u002f\u0073\u0063\u0072\u0069\u0070\u0074\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u0074\u0069\u0074\u006c\u0065\u003e\u005a\u006f\u006f\u006d\u002d\u0043\u0061\u006c\u006c\u002d\u0047\u0072\u006f\u0075\u0070\u002d\u004d\u0065\u0065\u0074\u0069\u006e\u0067\u003c\u002f\u0074\u0069\u0074\u006c\u0065\u003e\u000a\u003c\u002f\u0068\u0065\u0061\u0064\u003e\u003c\u0062\u006f\u0064\u0079\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u006d\u0061\u0069\u006e\u003e\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u003c\u006e\u0061\u0076\u003e\u000a\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u0020\u003c\u0064
